import Header from "../components/header/Header";
import { Table, Card, Button, Modal } from "antd";

export const CartPage = () => {
  const dataSource = [
    {
      key: "1",
      name: "Elma",
      price: 3,
      mount: 5,
    },
    {
      key: "2",
      name: "Karpuz",
      price: 1,
      mount: 50,
    },
  ];
  const columns = [
    {
      title: "Ürün Adı",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "Fiyat",
      dataIndex: "mount",
      key: "mount",
    },
    {
      title: "Adet",
      dataIndex: "price",
      key: "price",
    },
  ];

  const [isModalOpen, setIsModalOpen] = useState(false);

  const showModal = () => {
    setIsModalOpen(true);
  };

  const handleOk = () => {
    setIsModalOpen(false);
  };

  const handleCancel = () => {
    setIsModalOpen(false);
  };

  return (
    <div>
      <Header />
      <div className="px-6">
        <Table dataSource={dataSource} columns={columns} bordered />
        <div className="cart-total flex justify-end">
          <Card className="w-72">
            <div className="flex justify-between my-2">
              <span>Ara Toplam</span>
              <span> 549.00₺</span>
            </div>
            <div className="flex justify-between my-2">
              <span>KDV %8</span>
              <span className="text-red-600">+43.92₺</span>
            </div>
            <div className="flex justify-between">
              <span>
                <b>Toplam</b>
              </span>
              <b>
                <span>+43.92₺</span>
              </b>
            </div>
            <Button
              type="primary"
              onClick={showModal}
              size="middle"
              className="bg-green-600 mt-3 w-full"
            >
              Sipariş Oluştur
            </Button>
            <Modal
              title="Basic Modal"
              open={isModalOpen}
              onOk={handleOk}
              onCancel={handleCancel}
            >
              <p>Some contents...</p>
              <p>Some contents...</p>
              <p>Some contents...</p>
            </Modal>
          </Card>
        </div>
      </div>
    </div>
  );
};
